export default function EmpAction(){
  return({
      type : 'EmpAction',
      payload : [
          {
              id  : "1",
              name : "Naveen",
              email : "naveen@gmail.com"
          },
          {
              id  : "2",
              name : "Sai",
              email : "sai@gmail.com"
          },
          {
              id  : "3",
              name : "Amulya",
              email : "Amulya@gmail.com"
          },
          {
              id  : "4",
              name : "Likitha",
              email : "Likitha@gmail.com"
          }
      ]
  })
}
